  false,\n\t\"url\": null,\n\t\"notes\": \"The dataset for Tax Increment Financing
  (TIF) District Programming contains amounts shown in the TIF District Programming
  2015-2019 reports as well as 2020 through the planned expiration of each TIF district.
  The report and corresponding dataset show estimated fund and project balances through
  the end of FY 2014. Amounts shown in columns 2015 and later reflect known obligations
  and proposed projects as well as estimates of revenue based on the current equalized
  assessed value data for each TIF district produced by the Cook County Clerk.\",\n\t\"license_title\":
